import React, { Component } from 'react';
import './Header.css';
import logo from '../assets/logo.png';
import { Link } from 'react-router-dom';

const HeaderItem = (prop) => {
  return (
    <div className="header-item text-center d-none d-lg-block h2 col">
      <Link to={prop.linkName}>{prop.name}</Link>
    </div>
  );
}

const Logo = () => {
  return (
    <div className="logo text-center col">
      <img src={logo} height="220px" width="180px" alt="logo" />
    </div>
  )
}

class Header extends Component {
  render() {
    return (
      <div className="navigation row mx-0">
        <div className="header-item text-center d-none d-lg-block h2 col">
        <Link to={'/'}>Artwork</Link>
        </div>
        <HeaderItem linkName="{'/photo'}" name="Photo" />
        <Logo />
        <div className="header-item text-center d-none d-lg-block h2 col">
        <Link to={'/about'}>About</Link>
        </div>  
        <div className="header-item text-center d-none d-lg-block h2 col">
        <Link to={'/contact'}>Contact</Link>
        </div>  
      </div>
    );
  }
}

export default Header;
